import React from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';
import './route.css';

const HomePage = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh; /* Ensures the page takes at least full viewport height */
`;

const Header = styled.header`
  width: 100%;
  height: 80px;
  position: fixed;
  background: var(--color-white);
  z-index: 1000;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 20px;
`;

const Logo = styled.img`
  height: 60px;
  width: 60px;
  object-fit: cover;
`;

const Nav = styled.nav`
  display: flex;
  align-items: center;
  gap: var(--gap-xl);
`;

const NavItem = styled.a`
  text-decoration: none;
  color: var(--color-black);
  font-size: var(--font-size-base);
  font-family: var(--font-changa-one);
  font-weight: 400;
`;

const Button = styled.button`
  cursor: pointer;
  border: none;
  padding: var(--padding-sm) var(--padding-base);
  background: ${({ primary }) => primary
    ? 'linear-gradient(90deg, #1A2B51 0%, #EC8845 100%)'
    : 'var(--color-black)'
  };
  border-radius: var(--br-7xs);
  color: var(--color-white);
  font-size: var(--font-size-base);
  font-family: var(--font-khula);
  display: flex;
  align-items: center;
  justify-content: center;
`;

const HeroSection = styled.section`
  width: 100%;
  height: 300px;
  position: relative;
  margin-top: 80px;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;

const HeroImage = styled.img`
  width: 100%;
  height: 300px;
  object-fit: cover;
  position: absolute;
  top: 0;
  left: 0;
  z-index: -1;
`;

const HeroTitle = styled.h1`
  color: var(--color-white);
  font-size: 50px;
  font-family: var(--font-changa-one);
  font-weight: 400;
  text-align: center;
`;

const Section = styled.section`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: var(--padding-base);
  gap: var(--gap-xl);
`;

const ExploreColleges = styled.div`
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: center;
  gap: var(--gap-xl);
  flex-wrap: wrap;
`;

const Title = styled.h1`
  margin: 0;
  font-size: 1.5rem;
  font-family: var(--font-khula);
  flex-shrink: 0;
`;

const ProductImage = styled.img`
  loading: lazy;
  width: 100%;
`;

const ProductCard = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: var(--gap-xl);
  flex: 1;
  max-width: 300px;
`;

const SearchSection = styled.section`
  display: flex;
  align-items: center;
  justify-content: center;
  padding: var(--padding-base) 0;
`;

const SearchInput = styled.input`
  padding: var(--padding-sm);
  width: 100%;
  max-width: 500px;
  border: 1px solid var(--color-gray-100);
  border-radius: var(--br-7xs);
`;

const TestimonialsSection = styled.section`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: var(--padding-base);
`;

const Testimonial = styled.div`
  display: flex;
  align-items: center;
  margin-bottom: var(--padding-base);
`;

const Avatar = styled.img`
  loading: lazy;
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin-right: var(--gap-xl);
`;

const TestimonialText = styled.div`
  display: flex;
  flex-direction: column;
`;

const TestimonialName = styled.span`
  font-weight: bold;
`;

const TestimonialCourse = styled.span`
  color: var(--color-gray-100);
`;

const FooterContainer = styled.div`
  width: 100%;
  background: #121826;
`;

const FooterTop = styled.div`
  width: 100%;
  height: 69px;
  background: #121826;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const FooterLinks = styled.div`
  width: 459px;
  height: 36px;
  text-align: center;
  color: #FF9C00;
  font-size: 13px;
  font-family: 'Open Sans', sans-serif;
  font-weight: 600;
`;

const FooterMiddle = styled.div`
  width: 100%;
  height: 15px;
  background: #89A4E2;
`;

const FooterBottom = styled.div`
  width: 100%;
  height: 368px;
  background: #304368;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
`;

const FooterLinksSection = styled.div`
  width: 100%;
  max-width: 1200px;
  display: flex;
  justify-content: space-between;
  margin-bottom: 20px;
`;

const FooterLinkGroup = styled.div`
  display: flex;
  flex-direction: column;
`;

const FooterLink = styled.a`
  color: var(--color-white);
  text-decoration: none;
  margin-bottom: 10px;
  font-size: var(--font-size-base);
  &:hover {
    text-decoration: underline;
  }
`;

const SocialMediaIcons = styled.div`
  display: flex;
  gap: 15px;
`;

const SocialIcon = styled.a`
  width: 30px;
  height: 30px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const SocialIconImg = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

function Route() {
  const navigate = useNavigate();

  return (
    <HomePage>
      <Header>
        <Logo src="https://via.placeholder.com/60x60" alt="Logo" />
        <Nav>
          <NavItem href="#">Home</NavItem>
          <NavItem href="#">Spot round admission</NavItem>
          <NavItem href="#">College Predictor</NavItem>
          <NavItem href="#">Resources</NavItem>
          <NavItem href="#">Contact Us</NavItem>
        </Nav>
        <div style={{ display: 'flex', gap: '10px' }}>
          <Button primary onClick={() => navigate('/signup')}>
            <span>Sign Up</span>
          </Button>
          <Button onClick={() => navigate('/login')}>
            <span>Login</span>
          </Button>
        </div>
      </Header>
      <HeroSection>
        <HeroImage src="https://via.placeholder.com/1280x300" alt="Hero Image" />
        <HeroTitle>Explore 1000+ colleges and universities<br />and choose whatâ€™s best for YOU</HeroTitle>
      </HeroSection>
      <Section>
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: '20px' }}>
          <Button primary>
            <span>Get Started</span>
          </Button>
          <Button>
            <span>Explore Colleges</span>
          </Button>
        </div>
      </Section>
      <Section>
        <Title>Explore products</Title>
        <ExploreColleges>
          <ProductCard>
            <ProductImage src="https://via.placeholder.com/300x200" alt="Product 1" />
            <Title>SPOT ROUND ADMISSION</Title>
            <p>Info about what the product does</p>
            <Button primary>
              <span>EXPLORE</span>
            </Button>
          </ProductCard>
          <ProductCard>
            <ProductImage src="https://via.placeholder.com/300x200" alt="Product 2" />
            <Title>COLLEGE PREDICTOR</Title>
            <p>Info about what the product does</p>
            <Button primary>
              <span>EXPLORE</span>
            </Button>
          </ProductCard>
          <ProductCard>
            <ProductImage src="https://via.placeholder.com/300x200" alt="Product 3" />
            <Title>SPOT ROUND ADMISSION</Title>
            <p>Info about what the product does</p>
            <Button primary>
              <span>EXPLORE</span>
            </Button>
          </ProductCard>
        </ExploreColleges>
      </Section>
      <SearchSection>
        <SearchInput placeholder="Search for a college, course, exam, etc." />
      </SearchSection>
      <TestimonialsSection>
        <Title>What our students are saying</Title>
        <Testimonial>
          <Avatar src="https://via.placeholder.com/50x50" alt="Student 1" />
          <TestimonialText>
            <TestimonialName>John Doe</TestimonialName>
            <TestimonialCourse>B.Tech in Computer Science</TestimonialCourse>
            <p>This platform helped me find the perfect college for my course.</p>
          </TestimonialText>
        </Testimonial>
        <Testimonial>
          <Avatar src="https://via.placeholder.com/50x50" alt="Student 2" />
          <TestimonialText>
            <TestimonialName>Jane Smith</TestimonialName>
            <TestimonialCourse>MBA</TestimonialCourse>
            <p>Great resource for exploring colleges and understanding admission processes.</p>
          </TestimonialText>
        </Testimonial>
      </TestimonialsSection>
      <FooterContainer>
        <FooterTop>
          <FooterLinks>
            <a href="#about" style={{ color: '#FF9C00', textDecoration: 'none' }}>About Us</a> | 
            <a href="#contact" style={{ color: '#FF9C00', textDecoration: 'none' }}>Contact Us</a> | 
            <a href="#privacy" style={{ color: '#FF9C00', textDecoration: 'none' }}>Privacy Policy</a>
          </FooterLinks>
        </FooterTop>
        <FooterMiddle />
        <FooterBottom>
          <FooterLinksSection>
            <FooterLinkGroup>
              <h3 style={{ color: 'white' }}>QUICK LINKS</h3>
              <FooterLink href="#">Link 1</FooterLink>
              <FooterLink href="#">Link 2</FooterLink>
              <FooterLink href="#">Link 3</FooterLink>
            </FooterLinkGroup>
            <FooterLinkGroup>
              <h3 style={{ color: 'white' }}>USEFUL URLS</h3>
              <FooterLink href="#">URL 1</FooterLink>
              <FooterLink href="#">URL 2</FooterLink>
              <FooterLink href="#">URL 3</FooterLink>
            </FooterLinkGroup>
            <FooterLinkGroup>
              <h3 style={{ color: 'white' }}>FOLLOW US</h3>
              <SocialMediaIcons>
                <SocialIcon href="#">
                  <SocialIconImg src="https://via.placeholder.com/30x30" alt="Facebook" />
                </SocialIcon>
                <SocialIcon href="#">
                  <SocialIconImg src="https://via.placeholder.com/30x30" alt="Twitter" />
                </SocialIcon>
                <SocialIcon href="#">
                  <SocialIconImg src="https://via.placeholder.com/30x30" alt="Instagram" />
                </SocialIcon>
              </SocialMediaIcons>
            </FooterLinkGroup>
            <FooterLinkGroup>
              <h3 style={{ color: 'white' }}>ENTRANCE EXAMS</h3>
              <FooterLink href="#">Exam 1</FooterLink>
              <FooterLink href="#">Exam 2</FooterLink>
              <FooterLink href="#">Exam 3</FooterLink>
            </FooterLinkGroup>
            <FooterLinkGroup>
              <h3 style={{ color: 'white' }}>CONTACT US</h3>
              <FooterLink href="#">Email: contact@example.com</FooterLink>
              <FooterLink href="#">Phone: 123-456-7890</FooterLink>
            </FooterLinkGroup>
          </FooterLinksSection>
        </FooterBottom>
      </FooterContainer>
    </HomePage>
  );
}

export default Route;
